import Header from "./Header";

function Home() {
  return (
    <>
      <div className="main">
        <Header />
        <div className="body">
          <div className="grid-wrapper">
            <div className="grid">
              <div className="grid-title">
                <span>10 000RP</span>
              </div>
              <div className="">das</div>
              <div className="grid-price">412</div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
